import React, { Component } from "react";

import { Cards, Chart, CountryPicker } from "./components";
import Api from "./api/index";
import styles from "./App.module.css";

class App extends Component {
  state = {};
  render() {
    return (
      <div className={styles.container}>
        <Cards />
        <CountryPicker />
        <Chart />
      </div>
    );
  }
}

export default App;
